
public class MineP_elseif {
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int time = 10;
		if(time<10) {
			System.out.println("gn");
		}else if(time>10){
			System.out.println("ge");
		}else if(time = 10) {
			System.out.println("muskoni paduko");
		}
		else {
			System.out.println("gm");
		}
	}
}
		
		